import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { FiGraduationCap, FiBriefcase, FiAward, FiBookOpen } from 'react-icons/fi';
import './Timeline.css';

const Timeline = () => {
  const [ref, inView] = useInView({
    threshold: 0.1,
    triggerOnce: true
  });

  const timelineEvents = [
    {
      id: 1,
      year: "2019",
      title: "BBA – Finance & Marketing",
      institution: "Shree Medha Degree College",
      description: "Completed Bachelor's degree with strong foundation in business principles, finance, and marketing strategies.",
      icon: <FiGraduationCap size={20} />,
      type: "education"
    },
    {
      id: 2,
      year: "2023",
      title: "Joined MCA (AI & ML)",
      institution: "Lovely Professional University",
      description: "Started postgraduate studies specializing in Artificial Intelligence and Machine Learning.",
      icon: <FiBookOpen size={20} />,
      type: "education"
    },
    {
      id: 3,
      year: "2024",
      title: "Internship at Cipher Schools",
      institution: "Cipher Schools",
      description: "Hands-on experience in image classification with SVM and real-world machine learning applications.",
      icon: <FiBriefcase size={20} />,
      type: "experience"
    },
    {
      id: 4,
      year: "2025",
      title: "Advanced AI/ML Projects",
      institution: "LPU & Personal Projects",
      description: "Developed CIRC, YOLO-based systems, and emotion detection models showcasing advanced AI capabilities.",
      icon: <FiAward size={20} />,
      type: "achievement"
    }
  ];

  const getIconColor = (type) => {
    switch (type) {
      case 'education':
        return 'var(--primary-color)';
      case 'experience':
        return 'var(--accent-color)';
      case 'achievement':
        return 'var(--secondary-color)';
      default:
        return 'var(--primary-color)';
    }
  };

  return (
    <section id="timeline" className="timeline section" ref={ref}>
      <div className="container">
        <motion.div
          className="section-header"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6 }}
        >
          <h2>Career Timeline</h2>
          <p className="section-subtitle">
            My journey from business to artificial intelligence
          </p>
        </motion.div>

        <div className="timeline-container">
          <div className="timeline-line"></div>
          
          {timelineEvents.map((event, index) => (
            <motion.div
              key={event.id}
              className={`timeline-item ${index % 2 === 0 ? 'left' : 'right'}`}
              initial={{ opacity: 0, x: index % 2 === 0 ? -50 : 50 }}
              animate={inView ? { opacity: 1, x: 0 } : {}}
              transition={{ duration: 0.6, delay: index * 0.2 }}
            >
              <div className="timeline-content">
                <div className="timeline-icon" style={{ backgroundColor: getIconColor(event.type) }}>
                  {event.icon}
                </div>
                
                <div className="timeline-details">
                  <div className="timeline-year">{event.year}</div>
                  <h3 className="timeline-title">{event.title}</h3>
                  <div className="timeline-institution">{event.institution}</div>
                  <p className="timeline-description">{event.description}</p>
                </div>
              </div>
            </motion.div>
          ))}
        </div>

        <motion.div
          className="timeline-summary"
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.6, delay: 1.0 }}
        >
          <div className="summary-content">
            <h3>What's Next?</h3>
            <p>
              I'm actively seeking opportunities to apply my AI/ML expertise in real-world business scenarios. 
              My goal is to contribute to innovative projects that leverage artificial intelligence to solve 
              complex business challenges and create meaningful impact.
            </p>
            <div className="next-steps">
              <div className="step">
                <h4>Immediate Goals</h4>
                <p>Complete MCA program and secure AI/ML role</p>
              </div>
              <div className="step">
                <h4>Long-term Vision</h4>
                <p>Lead AI initiatives and drive business transformation</p>
              </div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Timeline;
